import React from 'react';
import './HomePage.css';  // Optional: Custom CSS file

// Navbar Component
const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-menu">
        <li><a href="#home">Trang chủ</a></li>
        <li><a href="#login">Đăng nhập</a></li>
        <li><a href="#register">Đăng ký</a></li>
        <li><a href="#support">Hỗ trợ</a></li>
        <li><a href="#contact">Liên hệ</a></li>
      </ul>
    </nav>
  );
};

// Banner Component
const Banner = () => {
  return (
    <div className="banner">
      <h1>Hệ thống AI Chatbot hỗ trợ học tiếng Anh</h1>
      <p>
        Nâng cao kỹ năng ngữ pháp, từ vựng và phát âm của bạn với sự hỗ trợ từ AI thông minh.
      </p>
    </div>
  );
};

// CTA (Call to Action) Component
const CTA = () => {
  return (
    <div className="cta">
      <button className="cta-button" onClick={() => alert('Đăng ký ngay!')}>
        Đăng ký ngay
      </button>
      <button className="cta-button cta-secondary" onClick={() => alert('Học thử ngay!')}>
        Học thử ngay
      </button>
    </div>
  );
};

// Home Page Component
const HomePage = () => {
  return (
    <div className="home-page">
      <Navbar />
      <Banner />
      <CTA />
    </div>
  );
};

export default HomePage;
